import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';

const Dashboard: React.FC = () => {
  const { isAuthenticated } = useAuth();
  const [stats, setStats] = useState({
    feeds: 0,
    animals: 0,
    comparisons: 0,
    brands: 0
  });

  const [loading, setLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      setLoading(true);
      setError(null);

      // Всегда загружаем публичные корма
      const feedsRes = await fetch('http://localhost:3001/api/feeds');

      if (!feedsRes.ok) {
        throw new Error('Ошибка загрузки кормов');
      }

      const feeds = await feedsRes.json();
      const uniqueBrands = new Set(feeds.map((feed: any) => feed.brand));

      if (isAuthenticated) {
        // Для авторизованных пользователей загружаем все данные
        try {
          const token = localStorage.getItem('token');
          const requestOptions: RequestInit = token 
            ? { headers: { 'Authorization': `Bearer ${token}` } }
            : {};

          const [animalsRes, comparisonsRes] = await Promise.all([
            fetch('http://localhost:3001/api/animals', requestOptions),
            fetch('http://localhost:3001/api/calculations', requestOptions)
          ]);

          if (animalsRes.ok && comparisonsRes.ok) {
            const [animals, calculations] = await Promise.all([
              animalsRes.json(),
              comparisonsRes.json()
            ]);

            setStats({
              feeds: feeds.length,
              animals: animals.length,
              comparisons: calculations.length,
              brands: uniqueBrands.size
            });
          } else {
            // Если не удалось загрузить защищенные данные, показываем только корма
            setStats({
              feeds: feeds.length,
              animals: 0,
              comparisons: 0,
              brands: uniqueBrands.size
            });
          }
        } catch (authError) {
          console.error('Ошибка загрузки защищенных данных:', authError);
          setStats({
            feeds: feeds.length,
            animals: 0,
            comparisons: 0,
            brands: uniqueBrands.size
          });
        }
      } else {
        // Для неавторизованных пользователей показываем только публичные данные
        setStats({
          feeds: feeds.length,
          animals: 0, // Для неавторизованных
          comparisons: 0, // Для неавторизованных  
          brands: uniqueBrands.size
        });
      }

    } catch (error) {
      console.error('Ошибка загрузки статистики:', error);
      setError('Не удалось загрузить данные');
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="loading">
        <div style={{ textAlign: 'center' }}>
          <div style={{ fontSize: '48px', marginBottom: '20px' }}>🐕</div>
          <div>Загружаем данные...</div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div style={{ 
        textAlign: 'center', 
        padding: '50px',
        color: '#F44336',
        background: 'rgba(244, 67, 54, 0.1)',
        borderRadius: '16px',
        margin: '20px'
      }}>
        <div style={{ fontSize: '48px', marginBottom: '20px' }}>⚠️</div>
        <h3>Ошибка загрузки</h3>
        <p>{error}</p>
        <button 
          onClick={fetchStats}
          className="btn btn-primary"
          style={{ marginTop: '20px' }}
        >
          Попробовать снова
        </button>
      </div>
    );
  }

  return (
    <div style={{ 
      padding: '20px',
      maxWidth: '1200px',
      margin: '0 auto',
      animation: 'fadeIn 0.8s ease-out'
    }}>
      {/* 🚀 СОВРЕМЕННЫЙ HERO-БЛОК */}
      <div style={{
        textAlign: 'center',
        marginBottom: '60px',
        padding: '80px 20px',
        background: 'var(--hero-gradient)',
        borderRadius: '32px',
        position: 'relative',
        overflow: 'hidden',
        color: 'white',
        backgroundSize: '400% 400%',
        animation: 'gradient-shift 6s ease infinite'
      }}>
        {/* Декоративные элементы */}
        <div style={{
          position: 'absolute',
          top: '30px',
          right: '30px',
          background: 'rgba(255, 255, 255, 0.2)',
          color: 'white',
          padding: '12px 20px',
          borderRadius: '25px',
          fontSize: '14px',
          fontWeight: '700',
          animation: 'float 3s ease-in-out infinite',
          backdropFilter: 'blur(10px)'
        }}>
          🌟 VET EDITION
        </div>

        <div style={{ 
          fontSize: '80px', 
          marginBottom: '30px',
          animation: 'paw-bounce 4s ease-in-out infinite'
        }}>
          🏥🐾
        </div>

        <h1 style={{
          fontSize: '4rem',
          fontWeight: '900',
          marginBottom: '24px',
          textShadow: '0 4px 20px rgba(0,0,0,0.3)',
          background: 'linear-gradient(45deg, #fff, #f0f0f0)',
          WebkitBackgroundClip: 'text',
          WebkitTextFillColor: 'transparent'
        }}>
          VetFormuLab Pro
        </h1>

        <p style={{
          fontSize: '1.5rem',
          marginBottom: '40px',
          maxWidth: '700px',
          margin: '0 auto 40px auto',
          opacity: 0.95,
          lineHeight: 1.4
        }}>
          Научные расчеты питания для профессиональных ветеринаров
        </p>

        {/* Главная CTA кнопка */}
        <Link 
          to="/calculator"
          style={{
            display: 'inline-flex',
            alignItems: 'center',
            gap: '12px',
            background: 'rgba(255, 255, 255, 0.95)',
            color: '#667eea',
            fontSize: '1.3rem',
            fontWeight: '700',
            padding: '20px 40px',
            borderRadius: '25px',
            textDecoration: 'none',
            backdropFilter: 'blur(10px)',
            border: '2px solid rgba(255, 255, 255, 0.3)',
            animation: 'zoom-in 1s ease-out 0.5s both',
            transition: 'all 0.3s cubic-bezier(0.175, 0.885, 0.32, 1.275)',
            boxShadow: '0 15px 35px rgba(0,0,0,0.2)'
          }}
          onMouseEnter={(e) => {
            e.currentTarget.style.transform = 'translateY(-4px) scale(1.05)';
            e.currentTarget.style.boxShadow = '0 25px 50px rgba(0,0,0,0.3)';
          }}
          onMouseLeave={(e) => {
            e.currentTarget.style.transform = 'translateY(0) scale(1)';
            e.currentTarget.style.boxShadow = '0 15px 35px rgba(0,0,0,0.2)';
          }}
        >
          🧮 Попробовать бесплатно
        </Link>
      </div>

      {/* 🧩 КАРТОЧКИ ПРЕИМУЩЕСТВ */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))',
        gap: '30px',
        marginBottom: '60px'
      }}>
        {/* Для ветеринаров */}
        <div className="card" style={{
          background: 'rgba(0, 200, 81, 0.05)',
          border: '2px solid rgba(0, 200, 81, 0.2)',
          animation: 'slide-in-left 0.8s ease-out 0.2s both'
        }}>
          <div style={{ fontSize: '48px', marginBottom: '20px', animation: 'heart-beat 2s infinite' }}>
            👨‍⚕️
          </div>
          <h3 style={{ color: 'var(--primary-green)', marginBottom: '15px' }}>
            Для ветеринаров
          </h3>
          <p style={{ color: 'var(--text-secondary)' }}>
            Профессиональные инструменты для точного расчета питания животных по международным стандартам
          </p>
        </div>

        {/* Расчёт по науке */}
        <div className="card" style={{
          background: 'rgba(51, 181, 229, 0.05)',
          border: '2px solid rgba(51, 181, 229, 0.2)',
          animation: 'zoom-in 0.8s ease-out 0.4s both'
        }}>
          <div style={{ fontSize: '48px', marginBottom: '20px', animation: 'float 3s ease-in-out infinite' }}>
            🔬
          </div>
          <h3 style={{ color: 'var(--secondary-blue)', marginBottom: '15px' }}>
            Расчёт по науке
          </h3>
          <p style={{ color: 'var(--text-secondary)' }}>
            Формулы основаны на метаболических исследованиях и рекомендациях ведущих ветеринарных организаций
          </p>
        </div>

        {/* Экономит время */}
        <div className="card" style={{
          background: 'rgba(255, 107, 53, 0.05)',
          border: '2px solid rgba(255, 107, 53, 0.2)',
          animation: 'slide-in-right 0.8s ease-out 0.6s both'
        }}>
          <div style={{ fontSize: '48px', marginBottom: '20px', animation: 'wiggle 3s ease-in-out infinite' }}>
            ⚡
          </div>
          <h3 style={{ color: 'var(--accent-orange)', marginBottom: '15px' }}>
            Экономит время
          </h3>
          <p style={{ color: 'var(--text-secondary)' }}>
            Мгновенные расчёты, готовые рекомендации и сравнение кормов в несколько кликов
          </p>
        </div>
      </div>

      {/* Баннер для неавторизованных пользователей */}
      {!isAuthenticated && (
        <div style={{
          background: 'linear-gradient(135deg, rgba(255, 143, 0, 0.1) 0%, rgba(255, 193, 7, 0.1) 100%)',
          border: '1px solid rgba(255, 143, 0, 0.3)',
          borderRadius: '20px',
          padding: '30px',
          marginBottom: '40px',
          textAlign: 'center',
          position: 'relative',
          overflow: 'hidden',
          animation: 'slideUp 0.8s ease-out'
        }}>
          <div style={{
            position: 'absolute',
            top: '10px',
            right: '15px',
            fontSize: '20px',
            animation: 'bounce 2s infinite'
          }}>
            ✨
          </div>

          <div style={{ fontSize: '40px', marginBottom: '15px' }}>🔑</div>

          <h3 style={{
            fontSize: '24px',
            fontWeight: '700',
            color: 'var(--accent-orange)',
            marginBottom: '12px'
          }}>
            Получите больше возможностей!
          </h3>

          <p style={{
            fontSize: '16px',
            color: 'var(--text-secondary)',
            marginBottom: '20px',
            maxWidth: '500px',
            margin: '0 auto 20px auto'
          }}>
            Зарегистрируйтесь в системе для сохранения истории расчетов, 
            создания профилей животных и доступа к расширенной аналитике.
          </p>

          <div style={{
            display: 'flex',
            justifyContent: 'center',
            gap: '15px',
            flexWrap: 'wrap'
          }}>
            <Link 
              to="/register"
              style={{
                background: 'var(--accent-gradient)',
                color: 'white',
                padding: '12px 24px',
                borderRadius: '25px',
                textDecoration: 'none',
                fontSize: '16px',
                fontWeight: '600',
                transition: 'all 0.3s ease',
                display: 'flex',
                alignItems: 'center',
                gap: '8px',
                boxShadow: '0 4px 15px rgba(255, 143, 0, 0.3)'
              }}
              onMouseEnter={(e) => {
                e.currentTarget.style.transform = 'translateY(-2px)';
                e.currentTarget.style.boxShadow = '0 6px 20px rgba(255, 143, 0, 0.4)';
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.transform = 'translateY(0)';
                e.currentTarget.style.boxShadow = '0 4px 15px rgba(255, 143, 0, 0.3)';
              }}
            >
              🚀 Создать аккаунт
            </Link>

            <Link 
              to="/login"
              style={{
                background: 'rgba(255, 143, 0, 0.1)',
                color: 'var(--accent-orange)',
                border: '2px solid rgba(255, 143, 0, 0.3)',
                padding: '10px 24px',
                borderRadius: '25px',
                textDecoration: 'none',
                fontSize: '16px',
                fontWeight: '600',
                transition: 'all 0.3s ease',
                display: 'flex',
                alignItems: 'center',
                gap: '8px'
              }}
              onMouseEnter={(e) => {
                e.currentTarget.style.background = 'rgba(255, 143, 0, 0.2)';
                e.currentTarget.style.transform = 'translateY(-2px)';
              }}
              onMouseLeave={(e) => {
                e.currentTarget.style.background = 'rgba(255, 143, 0, 0.1)';
                e.currentTarget.style.transform = 'translateY(0)';
              }}
            >
              🔓 Уже есть аккаунт
            </Link>
          </div>

          <div style={{
            display: 'flex',
            justifyContent: 'center',
            gap: '30px',
            marginTop: '25px',
            flexWrap: 'wrap'
          }}>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              fontSize: '14px',
              color: 'var(--text-secondary)'
            }}>
              💾 <span>Сохранение данных</span>
            </div>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              fontSize: '14px',
              color: 'var(--text-secondary)'
            }}>
              📊 <span>История расчетов</span>
            </div>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              gap: '8px',
              fontSize: '14px',
              color: 'var(--text-secondary)'
            }}>
              🐕 <span>Профили животных</span>
            </div>
          </div>
        </div>
      )}

      {/* Статистические карточки */}
      <div style={{
        display: 'grid',
        gridTemplateColumns: 'repeat(auto-fit, minmax(280px, 1fr))',
        gap: '24px',
        marginBottom: '40px'
      }}>
        {/* Карточка кормов */}
        <div className="card" style={{
          background: 'linear-gradient(135deg, rgba(76, 175, 80, 0.05) 0%, rgba(255, 255, 255, 0.95) 100%)',
          border: '1px solid rgba(76, 175, 80, 0.2)',
          animation: 'slideUp 0.6s ease-out'
        }}>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
            <div>
              <h3 style={{ 
                color: 'var(--text-secondary)', 
                fontSize: '14px', 
                fontWeight: '600',
                textTransform: 'uppercase',
                letterSpacing: '1px',
                marginBottom: '8px'
              }}>
                ВСЕГО КОРМОВ
              </h3>
              <div style={{ 
                fontSize: '36px', 
                fontWeight: '800', 
                color: 'var(--primary-green)',
                marginBottom: '8px'
              }}>
                {stats.feeds}
              </div>
              <div style={{ 
                color: 'var(--primary-green)', 
                fontSize: '14px',
                fontWeight: '600'
              }}>
                <span>📈 +12%</span> за месяц
              </div>
            </div>
            <div style={{
              background: 'var(--primary-gradient)',
              borderRadius: '16px',
              padding: '12px',
              animation: 'float 3s ease-in-out infinite'
            }}>
              🍖
            </div>
          </div>
        </div>

        {/* Карточка животных */}
        <div className="card" style={{
          background: 'linear-gradient(135deg, rgba(139, 195, 74, 0.05) 0%, rgba(255, 255, 255, 0.95) 100%)',
          border: '1px solid rgba(139, 195, 74, 0.2)',
          animation: 'slideUp 0.6s ease-out 0.1s both'
        }}>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
            <div>
              <h3 style={{ 
                color: 'var(--text-secondary)', 
                fontSize: '14px', 
                fontWeight: '600',
                textTransform: 'uppercase',
                letterSpacing: '1px',
                marginBottom: '8px'
              }}>
                ЖИВОТНЫХ
              </h3>
              <div style={{ 
                fontSize: '36px', 
                fontWeight: '800', 
                color: 'var(--secondary-green)',
                marginBottom: '8px'
              }}>
                {stats.animals}
              </div>
              <div style={{ 
                color: 'var(--secondary-green)', 
                fontSize: '14px',
                fontWeight: '600'
              }}>
                <span>📈 +5%</span> за месяц
              </div>
            </div>
            <div style={{
              background: 'var(--secondary-gradient)',
              borderRadius: '16px',
              padding: '12px',
              animation: 'paw-bounce 2s ease-in-out infinite'
            }}>
              🐕
            </div>
          </div>
        </div>

        {/* Карточка сравнений */}
        <div className="card" style={{
          background: 'linear-gradient(135deg, rgba(255, 143, 0, 0.05) 0%, rgba(255, 255, 255, 0.95) 100%)',
          border: '1px solid rgba(255, 143, 0, 0.2)',
          animation: 'slideUp 0.6s ease-out 0.2s both'
        }}>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
            <div>
              <h3 style={{ 
                color: 'var(--text-secondary)', 
                fontSize: '14px', 
                fontWeight: '600',
                textTransform: 'uppercase',
                letterSpacing: '1px',
                marginBottom: '8px'
              }}>
                СРАВНЕНИЙ
              </h3>
              <div style={{ 
                fontSize: '36px', 
                fontWeight: '800', 
                color: 'var(--accent-orange)',
                marginBottom: '8px'
              }}>
                {stats.comparisons}
              </div>
              <div style={{ 
                color: 'var(--accent-orange)', 
                fontSize: '14px',
                fontWeight: '600'
              }}>
                <span>📈 +8%</span> за месяц
              </div>
            </div>
            <div style={{
              background: 'var(--accent-gradient)',
              borderRadius: '16px',
              padding: '12px',
              animation: 'bounce 2s infinite'
            }}>
              📊
            </div>
          </div>
        </div>

        {/* Карточка брендов */}
        <div className="card" style={{
          background: 'linear-gradient(135deg, rgba(141, 110, 99, 0.05) 0%, rgba(255, 255, 255, 0.95) 100%)',
          border: '1px solid rgba(141, 110, 99, 0.2)',
          animation: 'slideUp 0.6s ease-out 0.3s both'
        }}>
          <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start' }}>
            <div>
              <h3 style={{ 
                color: 'var(--text-secondary)', 
                fontSize: '14px', 
                fontWeight: '600',
                textTransform: 'uppercase',
                letterSpacing: '1px',
                marginBottom: '8px'
              }}>
                БРЕНДОВ
              </h3>
              <div style={{ 
                fontSize: '36px', 
                fontWeight: '800', 
                color: 'var(--warm-brown)',
                marginBottom: '8px'
              }}>
                {stats.brands}
              </div>
              <div style={{ 
                color: 'var(--warm-brown)', 
                fontSize: '14px',
                fontWeight: '600'
              }}>
                <span>⭐ Премиум качество</span>
              </div>
            </div>
            <div style={{
              background: 'var(--warm-gradient)',
              borderRadius: '16px',
              padding: '12px',
              animation: 'glow 2s ease-in-out infinite alternate'
            }}>
              ⭐
            </div>
          </div>
        </div>
      </div>

      {/* Быстрые действия */}
      <div className="card" style={{
        animation: 'slideUp 0.6s ease-out 0.4s both',
        background: 'linear-gradient(135deg, rgba(255, 255, 255, 0.9) 0%, rgba(240, 248, 244, 0.9) 100%)',
        border: '1px solid rgba(76, 175, 80, 0.2)'
      }}>
        <h2 style={{ 
          marginBottom: '24px',
          color: 'var(--dark-green)',
          fontSize: '28px',
          display: 'flex',
          alignItems: 'center',
          gap: '12px'
        }}>
          🚀 Быстрые действия
        </h2>

        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))',
          gap: '20px'
        }}>
          <a href="/animals/new" className="btn btn-primary" style={{
            padding: '20px',
            borderRadius: '16px',
            textAlign: 'center',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: '600',
            background: 'var(--primary-gradient)',
            animation: 'glow 3s ease-in-out infinite alternate'
          }}>
            <div style={{ fontSize: '32px', marginBottom: '8px' }}>🐕</div>
            Добавить животное
          </a>

          <a href="/feeds" className="btn btn-secondary" style={{
            padding: '20px',
            borderRadius: '16px',
            textAlign: 'center',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: '600',
            background: 'var(--secondary-gradient)'
          }}>
            <div style={{ fontSize: '32px', marginBottom: '8px' }}>🍖</div>
            Просмотреть корма
          </a>

          <a href="/calculator" className="btn btn-accent" style={{
            padding: '20px',
            borderRadius: '16px',
            textAlign: 'center',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: '600',
            background: 'var(--accent-gradient)'
          }}>
            <div style={{ fontSize: '32px', marginBottom: '8px' }}>🧮</div>
            Рассчитать рацион
          </a>

          <a href="/comparisons" className="btn" style={{
            padding: '20px',
            borderRadius: '16px',
            textAlign: 'center',
            textDecoration: 'none',
            fontSize: '16px',
            fontWeight: '600',
            background: 'var(--warm-gradient)',
            color: 'white'
          }}>
            <div style={{ fontSize: '32px', marginBottom: '8px' }}>📊</div>
            Сравнить корма
          </a>
        </div>
      </div>

      {/* Информационная секция */}
      <div style={{
        marginTop: '40px',
        padding: '30px',
        textAlign: 'center',
        background: 'linear-gradient(135deg, rgba(76, 175, 80, 0.05) 0%, rgba(139, 195, 74, 0.05) 100%)',
        borderRadius: '20px',
        border: '1px solid rgba(76, 175, 80, 0.1)',
        animation: 'fadeIn 1s ease-out 0.6s both'
      }}>
        <div style={{ fontSize: '48px', marginBottom: '20px' }}>🌿</div>
        <h3 style={{ 
          color: 'var(--dark-green)', 
          marginBottom: '16px',
          fontSize: '24px'
        }}>
          Здоровое питание - залог долгой жизни питомца
        </h3>
        <p style={{ 
